events.event:
if(0 == memcmp($picture_ctrl.input_psd_again , $picture_ctrl.input_psd , 10))
{
    //两次输入密码正确
    memcpy($sys_set.admin_psd , $picture_ctrl.input_psd , 6);//复制密码到管理员密码
    $$HmiCommit;  
    sys_save_params();//保存好系统信息  

    strcpy($picture_ctrl.win_tip , "管理员密码修改成功");   
}
else
{
    strcpy($picture_ctrl.win_tip , "两次输入不匹配，请重新输入");

}
memset($picture_ctrl.input_psd,0,10);
memset($picture_ctrl.input_psd_again,0,10);
$$HmiCommit;
hmi_window_show("win_tip");
